                    </ul>
                    <input id='championSearchBar' type='search' data-target='dropdown1' required />
                    <label class='label-icon' for='championSearchBar'><i class='material-icons'>search</i></label>
                    
                    <i class='material-icons'>close</i>
                </div> */}
                <div class="row">
                  <div class="col s12">
                    <div class="row">
                      <div class="input-field col s12 grey darken-2">
                        <input type='text' id='champSearchBarAutoComplete' class='autocomplete'></input>
                        <label for='champSearchBarAutoComplete'>Search Champion Name</label>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
        </nav>
    );
  }
}

const mapStateToProps = (state) => {
    return { champions: state.champions }
  }
  
  export default connect(mapStateToProps, { selectChampion })(SearchBar);
